const image = new Image();

image.src = '—Pngtree—instagram icon instagram logo_3584852.png';
// image.src = 'data:image/jpeg;base64,';

image.addEventListener('load', () => {
    const canvs = document.querySelector('#canvas1');
    const ctx = canvs.getContext('2d');

    canvs.height = 800;
    canvs.width = 800;

    ctx.drawImage(image, 0, 0);

    const pixels = ctx.getImageData(0, 0, canvs.width, canvs.height);

    ctx.clearRect(0, 0, canvs.width, canvs.height);

    let particlesArray = [];
    const numberOfPaticles = 5000;



    let mappedImage = [];

    for (let y = 0; y < canvs.height; y++) {
        let row = [];

        for (let x = 0; x < canvs.width; x++) {
            const red = pixels.data[(y * 4 * pixels.width) + (x * 4)];
            const green = pixels.data[(y * 4 * pixels.width) + (x * 4 + 1)];
            const blue = pixels.data[(y * 4 * pixels.width) + (x * 4 + 2)];
            const brightness = calculateRealativeBrightness(red, green, blue);
            const cell = [
                cellBrightness = brightness,
                cellColor = 'rgb(' + red + ',' + green + ',' + blue + ')',
            ];

            row.push(cell);
        }
        mappedImage.push(row);
    }

    function calculateRealativeBrightness(red, green, blue) {
        return Math.sqrt((red * red) * 0.299 + (green * green) * 0.587 + (blue * blue) * 0.114) / 100;
    }

    class Particle {
        constructor() {
            this.x = Math.random() * canvs.width;

            this.y = 0;
            this.speed = 0;
            this.velocity = Math.random() * 0.5;
            this.size = Math.random() * 1.5 + 1;
            this.position1 = Math.floor(this.y);
            this.position2 = Math.floor(this.x);

        }

        update() {
            this.position1 = Math.floor(this.y);
            this.position2 = Math.floor(this.x);
            this.speed = mappedImage[this.position1][this.position2][0];
            let movement = (2.5 - this.speed) + this.velocity;

            // this.y += movement / 20;you can change both x and y according to you 
            this.y += movement;
            this.x += movement;

            if (this.y >= canvs.height) {
                this.y = 0;
                this.x = Math.random() * canvs.width;
            }

            if (this.x >= canvs.width) {
                this.x = 0;
                this.y = Math.random() * canvs.height;
            }
        }
        draw() {
            ctx.beginPath();
            ctx.fillStyle = mappedImage[this.position1][this.position2][1];
            ctx.arc(this.x, this.y, this.size, 0, Math.PI * 2);
            ctx.fill();
        }
    }

    function init() {
        for (let i = 0; i < numberOfPaticles; i++) {
            particlesArray.push(new Particle());
        }
    }

    init();

    function animate() {
        // ctx.drawImage(image, 0, 0);
        ctx.globalAlpha = 0.05; //for fading particles
        ctx.fillStyle = 'rgba(0,0,0)';
        ctx.fillRect(0, 0, canvs.width, canvs.height);
        ctx.globalAlpha = 0.2;

        for (let i = 0; i < particlesArray.length; i++) {

            particlesArray[i].update();
            ctx.globalAlpha = particlesArray[i].speed * 0.5;
            particlesArray[i].draw();
        }
        requestAnimationFrame(animate);
    }
    animate();
});